  false,\n\t\"url\": null,\n\t\"notes\": \" n        This evaluation report presents
  findings from the baseline data collected for the Irrigation and Water Resources
  Management (IWRM) project, which serves as the primary data source for evaluating
  the activities of the IWRM project.  This report provides an overview of the current
  irrigation and agricultural situation in the Senegal River Valley. Additionally,
  the report provides a comparison of treatment and comparison households to check
  for systematic differences between groups at the time of the baseline survey. nnIn
  the IWRM, the selection of areas to receive the project interventions was not random.
  Rather, it was based on a variety of factors, including political, social and environmental.
  In the absence of random assignment, we will use a Difference-in-Differences (DID)
  methodology combined with propensity score matching (DID-PSM) to estimate the impact
  of the IWRM activities. The baseline data includes community level and household
  level data. Community level data includes information about regional and socioeconomic
  characteristics of the village. Household level data sets were collected in 3 waves,
  one for each agricultural season.n      \",\n\t\"owner_org\": \"fcc9523d-f1cb-4ca4-83cb-c72c89079d2c\",\n\t\"extras\":
